import logo from './logo.svg';

function Header() {
  return (
    <header className="row navbar navbar-dark">
      <div className="col-4">
        <img src={logo} className="logo" alt="logo" />
      </div>
      <div className="col subtitle">
        <h1>React TypeScript App</h1>
      </div>
    </header>
  );
}

export default Header;
